// App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import FakeNewsAnalyzer from "./FakeNewsAnalyzer";
import GamePage from "./GamePage";  // Import GamePage

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<FakeNewsAnalyzer />} />
        <Route path="/game" element={<GamePage />} />  {/* Define GamePage route */}
      </Routes>
    </Router>
  );
};

export default App;  // Ensure default export
